import React from "react";

const Home = () => {

    const pic1 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00234.webp";
    const pic2 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00383.webp";

    const pic3 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00480.webp";
    const pic4 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00490.webp";
    const pic5 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00383.webp";
    const pic6 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00383.webp";
    const pic7 = "https://vkvrestauraties.s3.eu-central-003.backblazeb2.com/DSC00383.webp";

    return (
        <div className="w-full h-full">
            <div className="flex w-full h-1/4">
                <div className="w-1/4 h-full"></div>
                <div className="flex w-3/4 h-full">
                    <img src={pic3} alt="pic1" className="object-cover w-1/5 h-full"/>
                    <img src={pic4} alt="pic1" className="object-cover w-1/5 h-full"/>
                    <img src={pic5} alt="pic1" className="object-cover w-1/5 h-full"/>
                    <img src={pic6} alt="pic1" className="object-cover w-1/5 h-full"/>
                    <img src={pic7} alt="pic1" className="object-cover w-1/5 h-full"/>
                </div>
            </div>
            <div className="flex w-full h-3/4">
                <div className="w-1/4 h-full">
                    <img src={pic1} alt="pic1" className="object-cover w-full h-full"/>
                </div>
                <div className="w-3/4 h-full">
                    <img src={pic2} alt="pic2" className="object-cover w-full h-full"/>
                </div>
            </div>
        </div>
    );
}

export default Home;
